import React, { Component } from 'react';
import './mm_content.css';
import PieChart from 'react-chartjs';

const chartData = [
  {
    value: 300,
    color:"#F7464A",
    highlight: "#FF5A5E",
    label: "Red"
  },
  {
    value: 50,
    color: "#46BFBD",
    highlight: "#5AD3D1",
    label: "Green"
  },
  {
    value: 100,
    color: "#FDB45C",
    highlight: "#FFC870",
    label: "Yellow"
  }
]

const chartOptions = {
	//Boolean - Whether we should show a stroke on each segment
	segmentShowStroke : true,

	//String - The colour of each segment stroke
	segmentStrokeColor : "#fff",

	//Number - The width of each segment stroke
	segmentStrokeWidth : 2,

	//Number - The percentage of the chart that we cut out of the middle
	percentageInnerCutout : 50, // This is 0 for Pie charts

	//Number - Amount of animation steps
	animationSteps : 100,

	//String - Animation easing effect
	animationEasing : "easeOutBounce",

	//Boolean - Whether we animate the rotation of the Doughnut
	animateRotate : true,

	//Boolean - Whether we animate scaling the Doughnut from the centre
	animateScale : true,
	//String - A legend template
	legendTemplate : "<ul class=\"<%=name.toLowerCase()%>-legend\"><% for (var i=0; i<segments.length; i++){%><li><span style=\"background-color:<%=segments[i].fillColor%>\"><%if(segments[i].label){%><%=segments[i].label%><%}%></span></li><%}%></ul>"

}

class Content extends Component {


  render() {
    return (
      <div className="_content">
        <div className="_content_title">
            <h2>Financial Analysis</h2>
            <p>23:14, Thursday, Jan 26, 2019</p>
        </div>
        <Graph_spending/>
        <PieChart data={chartData} options={chartOptions} width="600" height="250"/>
      </div>
    );
  }
}

class Graph_spending extends Component {
    render(){
        return(
            <div>this is a graph</div>
        )
    }
}

class Pie_spending extends Component {
    render(){
        return(
            <div>this is a pie chart</div>
        )
    }
}

export default Content;
